import React from 'react'

function ReactTemplate(data) {


return (
    <>
    <section className="b_section">
      {/* <img src={data.src} alt="img"/> */}
      <div className="blogImage" style={{backgroundImage : "url("+data.src+")"}}></div>
      <div className="b_title">
        {data.title}
      </div>

      <div className="contents">
            <h2>Related Articles</h2>  
            <ul className="content_list">
              <li onClick={() => data.update(0)}>Article One</li>
              <li onClick={() => data.update(1)}>Article Two</li>
              <li onClick={() => data.update(2)}>Article Three</li>
              <li onClick={() => data.update(3)}>Article Four</li>
            </ul>
        </div>


      <div className="b_content">
        <h2 style={{fontSize:"25pt", color:"white", borderBottom:"2px solid white"}}>{data.subheading}</h2>
        {data.body}
      </div>
  </section>
    </>
);
}

export default ReactTemplate;
